import capsolver

# Replace with your actual CapSolver API key here
API_KEY = 'CAP-0328A2E6D64E9FC56B72B206413B914F6BC700434E594DECA985D3094CD98D72'

client = capsolver.Client(api_key=API_KEY)

def solve_captcha(base64_captcha):
    try:
        result = client.captcha.solve_captcha(
            captcha=base64_captcha,
            captcha_type='image_to_text'  # For normal image captchas
        )
        print('Captcha solved:', result['captcha'])
        return result['captcha']
    except Exception as e:
        print('Error solving captcha:', e)
        return None

if __name__ == '__main__':
    # Paste your base64 string between the triple quotes below:
    base64_captcha = ''''''

    solution = solve_captcha(base64_captcha)
    print('Solution:', solution)
